  background-color: white;
  border-radius: 20px;
  margin-top: 50px;
  display: flex;
  flex-direction: row;
  align-items: center;
  text-align: center;
  box-shadow: 0 10px 20px rgba(0, 0, 0, 0.19), 0 6px 6px rgba(0, 0, 0, 0.23);
`;


